/// <summary>
/// Initiliazes the image lists and sets the form texts.
/// </summary>
void init()
{
    super();

    GlobalizationInstrumentationHelper::featureRun(GlobalizationConstants::FeatureReferenceBR00090, funcName());

    imageListAppl_checkbox  = new ImageListAppl_checkbox();
    imageListAppl_Report    = new ImageListAppl_Report();
    imageListAppl_PadLock   = new ImageListAppl_PadLock();
    imageListAppl_RadioBtn  = new ImageListAppl_RadioBtn();

    this.setTexts();

    tableAllTree          .setImagelist(imageListAppl_Report.imageList());
    tableRelationTree     .setImagelist(imageListAppl_Report.imageList());
    tableSelectedTree     .setImagelist(imageListAppl_Report.imageList());
    fieldAllTree          .setImagelist(imageListAppl_Report.imageList());
    fieldSelectedTree     .setImagelist(imageListAppl_Report.imageList());
    sumAllTree            .setImagelist(imageListAppl_Report.imageList());
    sumSelectedTree       .setImagelist(imageListAppl_Report.imageList());
    sortAllTree           .setImagelist(imageListAppl_Report.imageList());
    sortSelectedTree      .setImagelist(imageListAppl_Report.imageList());
    rangeAllTree          .setImagelist(imageListAppl_Report.imageList());
    rangeSelectedTree     .setImagelist(imageListAppl_Report.imageList());

    sumSelectedTree       .setStateImagelist(imageListAppl_checkbox.imageList());
    fieldAllTree          .setStateImagelist(imageListAppl_PadLock.imageList());
    fieldSelectedTree     .setStateImagelist(imageListAppl_PadLock.imageList());
    sumSelectedTree       .setStateImagelist(imageListAppl_PadLock.imageList());
    sortSelectedTree      .setStateImagelist(imageListAppl_RadioBtn.imageList());

    if (element.args().caller())
    {
        confDefGroupWizard = element.args().caller();
    }
}

/// <summary>
/// Run method of the form.
/// </summary>
/// <remarks>
/// Only supported if being call from the ConfDefGroupWizard_BR class.
/// </remarks>
public void run()
{
    if (confDefGroupWizard)
    {
        super();
    }
    else
    {
        // fails
        ConfDefGroupWizard_BR::main(new Args());
        element.close();
    }
}

