void clicked()
{
    super();
    confDefGroupWizard.tableDelete(true);
    tableSelectedTree.setFocus();
    tableAllTree.setFocus();
}

public void selectionChanged(FormTreeItem _oldItem, FormTreeItem _newItem, FormTreeSelect _how)
