    super(_oldItem, _newItem, _how);
    confDefGroupWizard.enableButton(_newItem, tableRelationAddOne, false);
}

public void selectionChanged(FormTreeItem _oldItem, FormTreeItem _newItem, FormTreeSelect _how)
{
    super(_oldItem, _newItem, _how);
    confDefGroupWizard.enableUpDownButtons(this, _newItem, tableUp, tableDown);
    confDefGroupWizard.enableButton(_newItem, tableDeleteOne);
    tableAddOne.enabled(!tableSelectedTree.getChild(tableSelectedTree.getRoot()));
    tableAllTree.enabled(!tableselectedTree.getChild(tableSelectedTree.getRoot()));
}

